In Bevy, systems are the beating heart of your game: containing all of the necessary logic to actually make stuff happen . Systems are ordinary (if constrained) Rust functions that you use by: Defining the function with the appropriate argument types. Adding to your AppBuilder with functions like .add_system. Systems: Live within a 'Stage' , which control the broad timing and scheduling strategy of the system. Automatically run and supplied with data to read and write by Bevy's scheduler . Ordinary systems can accept any arguments that implement the SystemParam trait. The typical built-in options for this are: Queries (Query), which grab the components for all entities which have all of the specified components and pass the query filters . Resources (Res, ResMut and Local), which are global singletons for storing data that isn't associated with a particular entity. Commands (Commands), for queueing up broad-reaching tasks until the end of the stage. See Commands for an explanation of how these work. System-chained arguments (In), which automatically fetch the output of the system that is configured to chain into them. These are less common, and are discussed in Chaining Systems instead. Thread-local systems (discussed below) have complete (but not parallelizable) access to our app's state. They accept World (which collects all of the entity + component data) and Resources arguments instead. For simple projects, the most important distinction is between startup systems and ordinary systems. Startup systems run exactly once, before any ordinary systems run, while ordinary systems will run every tick. We can add systems to our apps with the add_system or add_startup_system methods. In the following example, we take a look at the skeleton of a reasonably complete small game, to demonstrate how systems would actually be used: // In this example, we show the structure of a reasonably complex slime volleyball game
