Assuming that we're working with a thread-safe resource that isn't system local, there are two different ways we can add resources to our app. When you're working with your AppBuilder (including through a plugin ), there are two ways to add resources: init_resource , which adds a resource of the type specified in its type parameter, with a starting value given by its Default trait. .add_resource , which sets a custom starting value for that type. Use .init_resource when you're planning to set it in a later system (perhaps because you need more complex logic), and use .add_resource when you have a good starting value. If you need to add or overwrite Resources at run-time, consider using commands with the .insert_resource method, which works the same as .add_resource above. Be mindful though: commands don't take effect until the end of each stage. Most of the time, you shouldn't need to do this: to modify a resource, instead create a system that gets a ResMut to the resource in question, then modify it within that system. Here's how you might add resources of various types for a mock RTS game: #![allow(warnings)]
use bevy::prelude::*; struct InfantryStats { hp: f32, damage: f32, speed: f32,
} // In order to use .init_resource, we need to specify a default starting value
// by implementing the Default trait
impl Default for InfantryStats { fn default() -> Self { InfantryStats { hp: 10.0, damage: 2.0, speed: 1.0, } }
} struct PlayerResources { gold: usize, wood: usize,
} struct MaxUnits(i32); enum PlayerColor { Red, Blue, Pink,
} fn main() { App::build() .init_resource::<InfantryStats>() // Structs and enums can all be used as resources .add_resource(PlayerResources { gold: 1000, wood: 500, }) .add_resource(MaxUnits(100)) .add_resource(PlayerColor::Pink) .run();
}

