To get started, Install Rust , then set up a new Bevy project ("Add Bevy as a Dependency") as described in the official book . The boilerplate needed to make your own app is simple: use bevy::prelude::*; fn main() { App::build().run();
} If you're looking for some useful functionality out of the box (windowing, graphics, input, a scheduler that automatically loops etc.), you'll want to add DefaultPlugins as well. use bevy::prelude::*; fn main() { App::build().add_plugins(DefaultPlugins).run();
} If all you need is a simple scheduler, you can use the minimal MinimalPlugins instead. This is a nice pattern for writing tests or examples, but could also be useful for running in headless mode or if you wanted to use Bevy's scheduler and ECS as part of a program that doesn't a GUI frontend. use bevy::prelude::*; fn main() { App::build().add_plugins(MinimalPlugins).run();
} By chaining methods together on the AppBuilder that we created with App::build, we can carefully build up our game's functionality in a modular fashion with the Builder pattern . To give you a taste of the syntax for Bevy's ECS, here's a not-quite-minimal Hello World example: use bevy::prelude::*;
use std::collections::HashMap;
